import React from 'react';
import styled from 'styled-components';
import { HeadText } from './WayToCome';
import { Hr } from './Calender';

export default function Contact() {
  return (
    <>
      <ContactWrapper>
        <HeadText>마음 전하실 곳</HeadText>
        <Hr />
        <GroomtCover />
        <BridaltCover />
      </ContactWrapper>
    </>
  );
}

export const ContactWrapper = styled.div`
  width: 100%;
  background-color: #fefbf8;
  padding-top: 4rem;
  display: flex;
  align-items: center;
  justify-content: center;
`;

export const GroomtCover = styled.div`
  width: 16rem;
  height: 3.5rem;
  background-color: #e6e7dd;
`;

export const BridaltCover = styled.div`
  width: 16rem;
  height: 3.5rem;
  background-color: #e6e7dd;
`;
